import { HomeSectionOne, HomeSectionTwo, HomeSectionThree, HomeSectionFour, } from "../sections";




const HomeBody = () => {
    return (
        <main className="absolute top-0 w-full sm:relative">
            <HomeSectionOne />
            <HomeSectionTwo />
            <HomeSectionThree />
            <HomeSectionFour />
        </main>
    );
};
export default HomeBody;
